import React, { useState } from 'react';
import './App.css';
import Footer from './components/Footer';
import Header from './components/Header';
import ProfileHeader from './components/ProfileHeader';
import ProfileInfo from './components/ProfileInfo';
import ProjectCard from './components/ProjectCard';
import Section from './components/Section';

function App() {
  const [showFinanceFriendVideo, setShowFinanceFriendVideo] = useState(false);
  const [showCinemaBookingVideo, setShowCinemaBookingVideo] = useState(false);
  const [showWikiTypeDemo, setShowWikiTypeDemo] = useState(false);

  const projects = [
    {
      title: 'WikiType',
      imageUrl: '/images/wikitype-demo.jpg',
      videoUrl: 'https://www.youtube.com/embed/dQw4w9WgXcQ?autoplay=1',
      description:
        'Wiki tape is a Web App that allows you to type out. Wikipedia articles in the context of a typing game. You can upload the URL of any Wikipedia page you want to type out and it will be added to your dashboard and then you can test out your typing skills. It tracks metrics such as words, per minute the progress through the whole file and many more. For the moment, a surprise video will be playing, but soon we will have a demo ready to be displayed.',
      githubUrl: 'https://github.com/dylanwcarter/wikitype',
      showVideo: showWikiTypeDemo,
      setShowVideo: setShowWikiTypeDemo,
    },
    {
      title: 'CinemaBooking',
      imageUrl: '/images/CinemaBooking.png',
      videoUrl: 'https://www.youtube.com/embed/lU0N8xuxupw?autoplay=1',
      description:
        'Cinema Booking is a movie ticket booking platform with user and admin roles, built using React, SpringBoot, and Postgres. Users can browse movies, book tickets, manage their profiles, and complete the checkout process. Admins have access to a separate interface for managing movies, users, promotions, schedules, prices, and fees. The app uses React Router for navigation, AuthContext for authentication, and includes pages for user authentication, account management, and error handling.',
      githubUrl: 'https://github.com/jimmymachine/csci_4050',
      showVideo: showCinemaBookingVideo,
      setShowVideo: setShowCinemaBookingVideo,
    },
    {
      title: 'Finance Friend',
      imageUrl: '/images/FinanceFriend.jpg',
      videoUrl: 'https://www.youtube.com/embed/uC2L6qnkAE4?autoplay=1',
      description:
        'Financial Friend is a financial advisment application designed to empower users with personalized, AI-driven insights and interactive tools to achieve their financial goals. By combining a customizable 3D AI advisor, and analytic dashboards, the application provides an engaging and accessible platform for users to help make informed decisions. The application leverages a modern tech stack, including React, Three.js, Node.js, and MongoDB, along with AI/ML technologies like the OpenAI API and Meshy, to deliver a secure and user-friendly experience that makes financial planning more approachable and effective. This was also created for a hackathon.',
      githubUrl: 'https://github.com/JohnMedlock/Portfolio',
      showVideo: showFinanceFriendVideo,
      setShowVideo: setShowFinanceFriendVideo,
    },
  ];

  return (
    <div className="App">
      <Header />
      <main>
        <ProfileHeader />
        <ProfileInfo />
        <Section title="Education">
          <p>
            University of Georgia<br />
            Bachelor of Science, Computer Science<br />
            Certificate in New Media<br />
            Expected Graduation: May 2026
          </p>
        </Section>
        <Section title="Honors and Awards">
          <dl>
            <dt>Zell Miller Scholarship Recipient</dt>
            <dd>University of Georgia, 2022 – Present</dd>
            <dt>Star Sailor Award</dt>
            <dd>University of Georgia Sailing Club, 2023</dd>
          </dl>
        </Section>
        <Section title="Skills">
          <ul>
            <li>Programming Languages: C, C++, C#, Java, Swift, Python, R, HTML, CSS, JavaScript</li>
            <li>Database: MySQL, Postgres, SwiftData</li>
            <li>Web Technologies: React, Shiny</li>
            <li>Tools: Git, VS Code, Eclipse</li>
            <li>Soft Skills: Team Management, Project Progression, Troubleshooting</li>
          </ul>
        </Section>
        <Section title="Leadership and Experience">
          <dl>
            <dt>
              <a href="https://oit.caes.uga.edu/" target="_blank" rel="noopener noreferrer">
                College of Agriculture and Environmental Sciences
              </a>
              <br />
              Information Technology Support Specialist, Athens, GA
            </dt>
            <dd>August 2024 - Present</dd>
            <dt>
              <a href="https://computing.uga.edu/" target="_blank" rel="noopener noreferrer">
                School of Computing
              </a>
              <br />
              Undergraduate Research Assistant, Athens, GA
            </dt>
            <dd>January 2024 - Present</dd>
            <dt>
              <a href="https://sepiainnovations.com/" target="_blank" rel="noopener noreferrer">
                Sepia Innovations
              </a>
              <br />
              Software Engineer Intern, Tokyo, Japan
            </dt>
            <dd>June 2024 - July 2024</dd>
          </dl>
        </Section>
        <Section title="Projects">
          <div className="three-col">
            {projects.map((project, index) => (
              <ProjectCard
                key={index}
                project={project}
                showVideo={project.showVideo}
                setShowVideo={(show) => {
                  if (project.title === 'WikiType') {
                    setShowWikiTypeDemo(show);
                  } else if (project.title === 'CinemaBooking') {
                    setShowCinemaBookingVideo(show);
                  } else if (project.title === 'Finance Friend') {
                    setShowFinanceFriendVideo(show);
                  }
                }}
              />
            ))}
          </div>
        </Section>
      </main>
      <Footer />
    </div>
  );
}

export default App;
